import React from "react";
import Card from './Card';
import emojipedia from '../emojipedia';



function createCard(emo) {
  return (
    <Card
      key={emo.id}
      emoji={emo.emoji}
      name={emo.name}
      meaning={emo.meaning}
    />
  );
}


function App() {
  return (
    <div>
      <h1>
        <span>Emojipedia</span>
      </h1>
      {emojipedia.map(createCard)}
    </div>
  );
}

export default App;
